I had to move out this function from quantize_model.cc, because I had troubles with tests:
for example, when {} is passed as const std::unordered_set<string>& operator_names, 
C++ uses the new version 
 TfLiteStatus QuantizeModel(flatbuffers::FlatBufferBuilder* builder,
                           ModelT* model, const TensorType& input_type,
                           const TensorType& output_type, bool allow_float,
                           const TensorType& activations_type,
                           ErrorReporter* error_reporter);
This is because it converts {} to TensorType.
It could be fixed by replacing enum TensorType to enum class TensorType, but I think this is a better solution.

